script: |
  super -f text -I q12798.spq | sort > q12798.out

inputs:
  - name: q12798.spq
    data: |
      SELECT DISTINCT + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT col2 BETWEEN NULL AND ( 45 + + + col0 + ( + + ( + - col1 ) ) * + col0 );
  - name: tab1

outputs:
  - name: q12798.out
    data: |
      14
      47
      5
